    nv.addGraph(function () {
        //var width = d3.select("#stackedAreaChartContainer").style('width'),
        //    height =  d3.select("#stackedAreaChartContainer").style('height');
        chart = nv.models.stackedAreaChart()
            .useInteractiveGuideline(true)

                return d[1]

            });

        nv.utils.windowResize(chart.update);
        return chart;
    });
